  false,\n\t\"url\": null,\n\t\"notes\": \"The proposed project is a part of the Ridgefield
  NWR invasive species management program, and will help achieve goals and priority
  habitats identified in the Refuge CCP. This project would provide funding for an
  amphibious all-terrain vehicle that would be used to access populations of shiny
  geranium (a Class A Washington species) and fragrant water lily. The project will
  survey approximately 250 acres as part of our Early Detection/Rapid Response (ED/RR)
  efforts. The project will focus treatment on eradicating these 2 key species which
  have the greatest potential for eradication as well as any occurrences of purple
  loosestrife and yellow flag iris that are encountered during surveys. Additional
  secondary species will be treated as resources permit within focal areas.\",\n\t\"license_title\":
